Parses.Sparql:
#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT ?x
WHERE {
  ns:m.081pw ns:time.event.start_date ?start ;
             ns:time.event.end_date ?end .
  ?x ns:government.politician.government_positions_held  ?y .
  ?y ns:government.government_position_held.office_position_or_title ns:m.060d2 ; # President of the United States
     ns:government.government_position_held.from  ?from ;
     ns:government.government_position_held.to  ?to .
  FILTER (?from < ?end)
  FILTER (?to > ?start)
}

#MANUAL SPARQL
PREFIX ns: <http://rdf.freebase.com/ns/>
SELECT DISTINCT  ?x
WHERE {
  {
    SELECT ?x (MAX(?yr) AS ?recent_yr)
    WHERE {
      ns:m.0d060g ns:location.location.contains ?x . # Canada
      ?x ns:common.topic.notable_types ns:m.01nm . # Canadian Province
      ?x ns:location.statistical_region.population ?y .
      ?y ns:measurement_unit.dated_integer.number ?p .
      ?y ns:measurement_unit.dated_integer.year ?yr .
    }
    GROUP BY ?x 
  }
  {
    SELECT ?x ?p ?yr
    WHERE {
      ns:m.0d060g ns:location.location.contains ?x . # Canada
      ?x ns:common.topic.notable_types ns:m.01nm . # Canadian Province
      ?x ns:location.statistical_region.population ?y .
      ?y ns:measurement_unit.dated_integer.number ?p .
      ?y ns:measurement_unit.dated_integer.year ?yr .
    }
  }
  FILTER (?yr = ?recent_yr)
}
ORDER BY DESC(xsd:integer(?p))
LIMIT 1

